import { styled } from 'styled-components';

export const FilterTimeSlide = styled.div`
  position: relative;
  height: 4px;
  width: 100%;
  border-radius: 10px;
  background-color: #ddd;
`;

export const FilterTimeSlideInner = styled.div`
  position: absolute;
  left: ${(props) => props.rangeMinPercent}%;
  right: ${(props) => props.rangeMaxPercent}%;
  height: 4px;
  border-radius: 10px;
  background-color: #b0b0b0;
`;

export const FilterTimeRangeWrap = styled.div`
  position: relative;
`;

export const FilterTimeRangeMin = styled.input`
  position: absolute;
  top: -9px;
  width: 100%;
  -webkit-appearance: none;
  background: none;
  &::-webkit-slider-thumb {
    height: 30px;
    width: 30px;
    border-radius: 50%;
    border: 2px solid #b0b0b0;
    background-color: #fff;
    -webkit-appearance: none;
  }
`;

export const FilterTimeRangeMax = styled(FilterTimeRangeMin)``;
